import React from "react";
import PropTypes from "prop-types";
import "./style.css"; // 스타일 파일 경로 확인

export const PropertyButtonWrapper = ({ className, property1, text }) => {
  const classNames = `button-wrapper ${property1} ${className || ""}`;
  return <button className={classNames}>{text}</button>;
};

PropertyButtonWrapper.propTypes = {
  className: PropTypes.string,
  property1: PropTypes.string,
  text: PropTypes.string.isRequired,
};

PropertyButtonWrapper.defaultProps = {
  className: "",
  property1: "",
};
